import React, { Component } from "react";
import Button from "@material-ui/core/Button";

const headerStyle = {
  color: "#ffcc00",
  fontFamily: "Quicksand",
  fontWeight: "bold",
  fontSize: "40px",
  position: "relative",
  bottom: "100px"
};

const gridStyle = {
  display: "grid",
  //gridTemplateColumns: "repeat(2, 1fr)",
  gridTemplateColumns: "repeat( auto-fill, minmax(420px, 1fr) )",
  gridColumnGap: "10px",
  gridRowGap: "70px",
  position: "relative",
  bottom: "80px"
};

const imgStyle = {
  width: "100%",
  height: "auto"
};

const textStyle = {
  color: "30323e",
  fontFamily: "Quicksand",
  backgroundColor: "#d8dcf2",
  opacity: "0.6",
  fontWeight: "bold"
};

class Results extends Component {
  render() {
    return (
      <React.Fragment>
        <h1 style={headerStyle}>The Temptation of St. Anthony</h1>
        <div style={gridStyle}>
          <img
            style={imgStyle}
            src="https://www.dhresource.com/0x0s/f2-albu-g1-M01-D0-D8-rBVaGVZrj5SAZX3WAAKKe5MhdsA908.jpg/abstract-painting-salvador-dali-oil-on-canvas.jpg"
            alt="Dali"
          />
          <div style={textStyle}>
            <h3>About the Painting</h3>
            <p>
              Lorem Ipsum is simply dummy text of the printing and typesetting
              industry. Lorem Ipsum has been the industry's standard dummy text
              ever since the 1500s, when an unknown printer took a galley of
              type and scrambled it to make a type specimen book. It has
              survived not only five centuries, but also the leap into
              electronic typesetting, remaining essentially unchanged. It was
              popularised in the 1960s with the release of Letraset sheets
              containing Lorem Ipsum passages, and more recently with desktop
              publishing software like Aldus PageMaker including versions of
              Lorem Ipsum.
            </p>
          </div>
          <img
            style={imgStyle}
            src="http://idora.milliyet.com.tr//OnedioGallery/Detail/2017/01/23/2197_pt5_01.jpg"
            alt="Dali"
          />
          <div style={textStyle}>
            <h3>About the Artist</h3>
            <p>
              Lorem Ipsum is simply dummy text of the printing and typesetting
              industry. Lorem Ipsum has been the industry's standard dummy text
              ever since the 1500s, when an unknown printer took a galley of
              type and scrambled it to make a type specimen book. It has
              survived not only five centuries, but also the leap into
              electronic typesetting, remaining essentially unchanged. It was
              popularised in the 1960s with the release of Letraset sheets
              containing Lorem Ipsum passages, and more recently with desktop
              publishing software like Aldus PageMaker including versions of
              Lorem Ipsum.
            </p>
          </div>
        </div>
        <Button
          variant="contained"
          color="secondary"
          style={{ marginBottom: 70 }}
          onClick={() => this.props.dispatch(reset())}
        >
          Go Back
        </Button>
      </React.Fragment>
    );
  }
}

export default Results;
